  syscall
  
  li    $s3, 113
  li    $s4, 203
  jal   drawNumber
  
  la    $a0, endl                    # print endl
  li    $v0, 4
  syscall

  j checkValid

checkBound:
  slti  $t0, $v0, 7                  # xA < 7
  and   $a1, $t0, $t0
  slt   $t0, $v0, $zero              # xA < 0
  xori  $t0, $t0, 1
  and   $a1, $a1, $t0
  jr    $ra

inputFailedBound:
  la    $a0, errorBound
  li    $v0, 4
  syscall

  li    $t1, 3
  li    $t2, 10
  li    $t3, 200
  li    $t9, 16
  li    $t4, 0x00084b83             # cover the message
  jal   drawColor

  la    $t7, errorBoundSprite
  li    $t1, 3                      # x-coordinate
  li    $t2, 10                     # y-coordinate
  li    $t3, 108                    # width
  li    $t9, 16                     # height
  jal   drawSprite

  j     inputFailed

inputFailedFormat:
  la    $a0, errorFormat
  li    $v0, 4
  syscall

  li    $t1, 3
  li    $t2, 10
  li    $t3, 200
  li    $t9, 16
  li    $t4, 0x00084b83             # cover the message
  jal   drawColor

  la    $t7, errorFormatSprite
  li    $t1, 3                      # x-coordinate
  li    $t2, 10                     # y-coordinate
  li    $t3, 116                    # width
  li    $t9, 16                     # height
  jal   drawSprite

  j     inputFailed

inputFailedCollision:
  la    $a0, errorCollision
  li    $v0, 4
  syscall

  li    $t1, 3
  li    $t2, 10
  li    $t3, 200
  li    $t9, 16
  li    $t4, 0x00084b83             # cover the message
  jal   drawColor

  la    $t7, errorCollisionSprite
  li    $t1, 3                      # x-coordinate
  li    $t2, 10                     # y-coordinate
  li    $t3, 90                     # width
  li    $t9, 16                     # height
  jal   drawSprite

  j     inputFailed

checkValid:  
  li    $a0, 250
  li    $v0, 32                      # delay 0.25s before checking, left time for displaying
  syscall

  li    $t1, 3
  li    $t2, 10
  li    $t3, 200
  li    $t9, 16
  li    $t4, 0x00084b83              # cover the error message
  jal   drawColor

  ## Check valid input
  la    $s5, input                   # condition A: $s1 = (xA < 7 && xB < 7 && yA < 7 && yB < 7 && xA >= 0 && xB >= 0 && yA >= 0 && yB >= 0)
  li    $s1, 1

  lw    $s6, 0($s5)
  slti  $t0, $s6, 7                  # xA < 7
  and   $s1, $s1, $t0
  slt   $t0, $s6, $zero              # xA < 0
  xori  $t0, $t0, 1
  and   $s1, $s1, $t0
  addi  $s5, $s5, 4

  lw    $s6, 0($s5)
  slti  $t0, $s6, 7                  # yA < 7
  and   $s1, $s1, $t0
  slt   $t0, $s6, $zero              # yA < 0
  xori  $t0, $t0, 1
  and   $s1, $s1, $t0
  addi  $s5, $s5, 4
  
  lw    $s6, 0($s5)
  slti  $t0, $s6, 7                  # xB < 7
  and   $s1, $s1, $t0
  slt   $t0, $s6, $zero              # xB < 0
  xori  $t0, $t0, 1
  and   $s1, $s1, $t0
  addi  $s5, $s5, 4

  lw    $s6, 0($s5)
  slti  $t0, $s6, 7                  # yB < 7
  and   $s1, $s1, $t0
  slt   $t0, $s6, $zero              # yB < 0
  xori  $t0, $t0, 1
  and   $s1, $s1, $t0                # $s1: result of condition A

  la    $s5, input                   # condition B: $s2 = (abs(xA + yA - xB - yB) == shipSize[ship] - 1)
  li    $t0, 0

  lw    $s4, 0($s7)
  addi  $s4, $s4, -1

  lw    $s6, 0($s5)
  addi  $s5, $s5, 4
  add   $t0, $t0, $s6
  
  lw    $s6, 0($s5)
  addi  $s5, $s5, 4
  add   $t0, $t0, $s6

  lw    $s6, 0($s5)
  addi  $s5, $s5, 4
  sub   $t0, $t0, $s6

  lw    $s6, 0($s5)
  sub   $t0, $t0, $s6

  slt   $t3, $t0, $zero
  sub   $t4, $zero, $t0
  movn  $t0, $t4, $t3

  seq   $s2, $t0, $s4

  la    $s5, input                   # condition C: $s3 = (xA == xB || yA == yB)

  lw    $t0, 0($s5)                  # load xA
  lw    $t1, 4($s5)                  # load yA
  lw    $t2, 8($s5)                  # load xB
  lw    $t3, 12($s5)                 # load yB

  seq   $t4, $t0, $t2                # xA == xB
  seq   $t5, $t1, $t3                # yA == yB

  or    $s3, $t4, $t5                # $s3: result of condition C

  beqz  $s1, inputFailedBound
  beqz  $s2, inputFailedFormat
  beqz  $s3, inputFailedFormat

  ## Check collision & input
  la    $s5, input
  lw    $t0, 0($s5)
  lw    $t1, 8($s5)
  
  lw    $a1, toggleInput
  beq   $a1, 1, setPlayerB
  la    $s6, playerA
  j     exitSetPlayerB

setPlayerB:
  la    $s6, playerB

exitSetPlayerB:
  bne   $t0, $t1, equalY

equalX:  
  sll   $t5, $t0, 2
  mul   $t5, $t5, 7
  add   $t5, $t5, $s6

  lw    $t2, 4($s5)
  lw    $t3, 12($s5)
  blt   $t2, $t3, noSwapY
  
  sw    $t3, 4($s5)
  sw    $t2, 12($s5)

noSwapY:
  lw    $t4, 4($s5)
  lw    $t3, 12($s5)

  addi  $t3, $t3, 1
  sll   $a0, $t4, 2
  add   $t5, $t5, $a0
  move  $t6, $t5

  leX1:
    lw    $v0, 0($t6)
    beq   $v0, 1, inputFailedCollision
    add   $t6, $t6, 4

    addi  $t4, $t4, 1
    blt   $t4, $t3, leX1

  lw    $t4, 4($s5)  
  move  $t6, $t5
  li    $v0, 1

  leX2:
    sw    $v0, 0($t6)
    add   $t6, $t6, 4

    addi  $t4, $t4, 1
    blt   $t4, $t3, leX2

  j endOneInput

equalY:
  lw    $t2, 4($s5)
  blt   $t0, $t1, noSwapX

  sw    $t0, 8($s5)
  sw    $t1, 0($s5)

noSwapX:
  lw    $t0, 0($s5)
  lw    $t1, 8($s5)
  addi  $t1, $t1, 1

  sll   $t5, $t0, 2
  mul   $t5, $t5, 7
  sll   $a0, $t2, 2

  add   $t5, $t5, $a0
  add   $t5, $t5, $s6
  move  $t6, $t5
  
  leY1:
    lw    $v0, 0($t6)
    beq   $v0, 1, inputFailedCollision
    add   $t6, $t6, 28

    addi  $t0, $t0, 1
    blt   $t0, $t1, leY1

  li    $v0, 1
  move  $t6, $t5
  lw    $t0, 0($s5)

  leY2:
    sw    $v0, 0($t6)
    add   $t6, $t6, 28

    addi  $t0, $t0, 1
    blt   $t0, $t1, leY2

endOneInput:

#### Write to file  
  lw    $a1, toggleInput
  beq   $a1, 1, writeB

writeA:
  li    $v0, 15                       # write to file
  lw    $a0, fileDescriptor
  la    $a1, promptPA
  li    $a2, 25
  syscall

  j     exitWriteB

writeB:
  li    $v0, 15                       # write to file
  lw    $a0, fileDescriptor
  la    $a1, promptPB
  li    $a2, 25
